import React from 'react'
import { AuthFormCmp } from '../cmps/AuthFormCmp'

export const Login = () => {

    const onLogin = () => {
        console.log('logged in!');
    }

    return (
        <div>
            <AuthFormCmp title="Login" btnTxt="Login" func={onLogin} />
        </div>
    )
}
